import React, { Component } from 'react'
import { Input } from 'antd';
import 'antd/dist/antd.css';
import { UserOutlined,LockOutlined,PhoneOutlined,DiffOutlined } from '@ant-design/icons'
import './index.css'

export default class Register extends Component {
    render() {

        return (
            <div id="Registerwrp">
                <Input onChange={this.saveRegistrationstudentId} className="int1" placeholder="请输入学号" prefix={<UserOutlined />} />
                <Input.Password onChange={this.saveRegistrationpassword} className="int1" prefix={<LockOutlined />} placeholder="请输入密码"/>
                <Input className="int1" onChange={this.saveRegistrationName} placeholder="请输入姓名" prefix={<DiffOutlined />} />
                <Input className="int1"  placeholder="请输入电话" prefix={<PhoneOutlined />} />
                <button className="Registerbtn">注册</button>
            </div>
        )
    }
}
